"use client";

import { gql, useLazyQuery, useMutation, useQuery } from "@apollo/client";
import { useState, useContext } from "react";
import { UserContext } from "../../context/context";
const CREATE_GYM = gql`
  mutation RegisterGym($input: GymRegisterInput!) {
    registerGym(input: $input) {
      id
      name
      ownerid
      title
      postition
      image
      rate
      pending
      thumbnail
    }
  }
`;

export default function AddPost() {
  const { user } = useContext(UserContext);
  const [CreateGym, { data: createdData, loading: createLoading, error: createError }] = useMutation(CREATE_GYM);
  const uploadimg = "https://i.ibb.co/h1v2j5g/Screen-Shot-2023-05-17-at-19-30-05.png";
  const [name, setName] = useState("");
  const [title, setTitle] = useState("");
  const [postition_x, setPostition_x] = useState("");
  const [postition_y, setPostition_y] = useState("");
  const [image, setImage] = useState([
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSffDMJq1zhSTfHzUPwS7XIuM5a8xW_w8K3iA&s",
  ]);
  const [thumbnail, setThumbnail] = useState("https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTPY1AdZ9K2TNI8Lwa5Gi4gn6Bb2zTMLj34Ag&s");
  const handleCreate = () => {
    CreateGym({
      variables: {
        input: {
          name,
          ownerid: user.user_id,
          title,
          postition: [postition_x, postition_y],
          rate: "10",
          thumbnail,
          image,
        },
      },
      onCompleted: (data) => {
        console.log(data);
        alert("create gym");
      },
      onError: (err) => {
        console.log(err);
      },
    });
  };

  return (
    <div className="w-full  pt-[1520px]  bg-[#15122A] pb-[120px]  flex ">
      <div className="w-[15%]"></div>
      <div className="w-[100%] flex ">
        <div className="w-[100%]  flex flex-col  gap-[20px] ">
          <div className="flex w-full items-center justify-center">
            <div className="w-[82%] flex  flex-col gap-[20px]">
              <p className="text-[45px]">Name</p>
              <input
                type="text"
                placeholder="name"
                onChange={(e) => setName(e.target.value)}
                className="w-[100%] bg-transparent h-[50px] rounded-[10px] pl-[30px] border-2 border-sky-500 border-dashed"
              />
            </div>
          </div>
          <div className="flex w-full items-center justify-center">
            <div className="w-[82%] flex  flex-col gap-[20px]">
              <p className="text-[45px]">title</p>
              <input
                type="text"
                placeholder="title"
                onChange={(e) => setTitle(e.target.value)}
                className="w-[100%] bg-transparent h-[50px] rounded-[10px] pl-[30px] border-2 border-sky-500 border-dashed"
              />
            </div>
          </div>
          <div className="flex w-full items-center justify-center">
            <div className="w-[82%] flex  flex-col gap-[20px]">
              <p className="text-[45px]">bairlal</p>
              <input
                type="text"
                placeholder="x-"
                onChange={(e) => setPostition_x(e.target.value)}
                className="w-[100%] bg-transparent h-[50px] rounded-[10px] pl-[30px] border-2 border-sky-500 border-dashed"
              />
              <input
                type="text"
                placeholder="y-"
                onChange={(e) => setPostition_y(e.target.value)}
                className="w-[100%] bg-transparent h-[50px] rounded-[10px] pl-[30px] border-2 border-sky-500 border-dashed"
              />
            </div>
          </div>

          <div className="w-[100%] flex flex-col gap-[20px] items-center">
            <button className="w-[500px] h-[60px] bg-transparent border-2 border-sky-500 border-dashed rounded-[10px]" onClick={handleCreate}>
              add new Gym
            </button>
          </div>
        </div>
      </div>
      <div className="w-[15%]"></div>
    </div>
  );
}
